t","philosophy"],"keywords":["liberal arts","western","fine arts","art history","design","social science","human","human rights","performing arts","history","schools","subjects","art studies","sociology","philosophy","psyhcology"],"name":"Arts and Humanities","description":"Specializations and courses in the arts and humanities (including fine arts, history, and philosophy) explore the historical context of creative works and teach you to review source material critically, draw connections between diverse ideas, and evaluate evidence and arguments. Coursework in this field will help you become a better reader, thinker, artist, and writer.","id":"arts-and-humanities"},{"subdomainIds":["leadership-and-management","finance","marketing","entrepreneurship","business-essentials","business-strategy"],"keywords":["small business","international business","business administration","business management","opportunities","sell","finance","economic","global","ethics","investment"],"name":"Business","description":"Business Specializations and courses help you hone skills critical to success in the modern workplace, with areas of study including entrepreneurship, business strategy, marketing, finance, and management. Whether you're a small business owner or working in a large international firm, business courses will improve your ability to analyze, understand, and solve business problems.","id":"business"},{"subdomainIds":["software-development","mobile-and-web-development","algorithms","computer-security-and-networks","design-and-product"],"keywords":["program","engineering","introduction","theoretical","mathematics","projects","computational science","technology","networking","graphics","applications","algorithms","programming"],"name":"Computer Science","description":"Computer science Specializations and courses teach software engineering and design, algorithmic thinking, human-computer interaction, programming languages, and the history of computing. Courses in this broad field will help you think abstractly, approach problems methodically, and develop sound solutions.","id":"computer-science"},{"subdomainIds":["data-analysis","machine-learning","probability-and-statistics"],"keywords":["qualitative data analysis","exploratory data analysis","tools","methods","techniques","software","research","analyst","interpretation"],"name":"Data Science","description":"Data science Specializations and courses teach the fundamentals of interpreting data, performing analyses, and understanding and communicating actionable insights. Topics of study for beginning and advanced learners include qualitative and quantitative data analysis, tools and methods for data manipulation, and machine learning algorithms.","id":"data-science"},{"subdomainIds":["animals-and-veterinary-science","bioinformatics","biology","medicine-and-healthcare","nutrition","clinical-science"],"keywords":["science","cellular","molecular","agriculture","companies","branches","impact factor","bio","biotechnology","zoology","biology","neuroscience","horticulture","biochemistry","plant"],"name":"Life Sciences","description":"Life sciences Specializations and courses explore properties of organisms and living ecosystems, with subtopics including biology, nutrition, zoology, and healthcare. Courses in this field will improve your understanding of animal and plant life, and your ability to analyze how complex systems interact with each other and respond to change.","id":"life-sciences"},{"subdomainIds":["math-and-logic"],"keywords":["problems","logical","mathematical","philosophy","calculator","puzzles","logically","thinking","reasoning","fallacies","computational","symbols","solving","applications","everyday","models"],"name":"Math and Logic","description":"Specializations and courses in math and logic teach sound approaches to solving quantifiable and abstract problems. You'll tackle logic puzzles, develop computational skills, build your ability to represent real-world phenomena abstractly, and strengthen your reasoning capabilities.","id":"math-and-logic"},{"subdomainIds":["personal-development"],"keywords":["plan","goals","skills","coach","tips","self","improvement","personality","professional","goal setting","growth","activities","best","action","leadership"],"name":"Personal Development","description":"Personal development Specializations and courses teach strategies and frameworks for personal growth, goal setting, and self improvement. You'll learn to manage personal finances, deliver effective speeches, make ethical decisions, and think more creatively.","id":"personal-development"},{"subdomainIds":["electrical-engineering","mechanical-engineering","chemistry","environmental-science-and-sustainability","physics-and-astronomy","research-methods"],"keywords":["computer","electrical","civil","mechanical","sciences","physics","mathematics","engineer","chemistry","material","chemical","technology","experiments","astronomy","earth","geoscience"],"name":"Physical Science and Engineering","description":"Physical science and engineering Specializations and courses teach the properties of the world around us, from core concepts in physics and chemistry to applied topics in engineering. Courses in this field will prepare you for a career in electrical, civil, or mechanical engineering, or in research or applied science.","id":"physical-science-and-engineering"},{"subdomainIds":["economics","education","governance-and-society","law","psychology"],"keywords":["medicine","economics","humanities","psycholoy","social","studies","behavioral","science","applied","research","methods","disciplines","statistical","history"],"name":"Social Sciences","description":"Social sciences Specializations and courses explore how populations form laws, make decisions, behave in groups, and structure their communities. From education to economics to psychology, courses in the social sciences will improve your understanding of the dynamics between individuals and groups, and your ability to analyze behaviors and trends.","id":"social-sciences"},{"subdomainIds":["learning-english","other-languages"],"keywords":["lessons","learn","language learning","learn chinese","learn english","english language courses","learn to speak","foreign language","spanish","other languages","grammar","speaking","conversation","writing"],"name":"Language Learning","description":"In language courses and Specializations, youll learn to speak, write, and listen effectively in major global languages, including English, Chinese, Spanish, and more. Whether youre learning a foreign language or improving your communication skills in your native language, coursework in this area will help you understand grammar and syntax conventions, and will prepare you to communicate with confidence in both business interactions and casual conversation.","id":"language-learning"}],"courseId":"Gtv4Xb1-EeS-ViIACwYKVQ","courseSlug":"machine-learning","rawCourseMaterials":{"courseData":{"isReal":true,"certificatePurchaseEnabledAt":1478024316146,"estimatedWorkload":"","description":"Machine learning is the science of getting computers to act without being explicitly programmed. In the past decade, machine learning has given us self-driving cars, practical speech recognition, effective web search, and a vastly improved understanding of the human genome. Machine learning is so pervasive today that you probably use it dozens of times a day without knowing it. Many researchers also think it is the best way to make progress towards human-level AI. In this class, you will learn about the most effective machine learning techniques, and gain practice implementing them and getting them to work for yourself. More importantly, you'll learn about not only the theoretical underpinnings of learning, but also gain the practical know-how needed to quickly and powerfully apply these techniques to new problems. Finally, you'll learn about some of Silicon Valley's best practices in innovation as it pertains to machine learning and AI.\n\nThis course provides a broad introduction to machine learning, datamining, and statistical pattern recognition. Topics include: (i) Supervised learning (parametric\u002Fnon-parametric algorithms, support vector machines, kernels, neural networks). (ii) Unsupervised learning (clustering, dimensionality reduction, recommender systems, deep learning). (iii) Best practices in machine learning (bias\u002Fvariance theory; innovation process in machine learning and AI). The course will also draw from numerous case studies and applications, so that you'll also learn how to apply learning algorithms to building smart robots (perception, control), text understanding (web search, anti-spam), computer vision, medical informatics, audio, database mining, and other areas.","isRestrictedMembership":false,"domainTypes":[{"subdomainId":"machine-learning","domainId":"data-science"}],"verificationEnabledAt":1478024316146,"isVerificationEnabled":true,"sessionsEnabledAt":1439918100000,"previewUserIds":[491129,8299040,8397658,8126958,7808088,5616754,5975642,2302205,1069047,6208622,2900062,8023553,579854,3404125,904450,4514174,3184415,9280841,2873883,2043183],"id":"Gtv4Xb1-EeS-ViIACwYKVQ","slug":"machine-learning","instructorIds":["1244"],"subtitleLanguageCodes":["es","ja","zh-CN"],"enrollableSiteUserRoles":[],"promoPhoto":"https:\u002F\u002Fcoursera.s3.amazonaws.com\u002Ftopics\u002Fml\u002Flarge-icon.png","primaryLanguageCodes":["en"],"partnerIds":["1"],"categoryIds":[16,17],"isSubtitleTranslationEnabled":true,"name":"Machine Learning","courseStatus":"launched","launchedAt":1425088202363,"overridePartnerLogos":{},"instructors":[{"lastName":"Andrew Ng","prefixName":"","photo":"https:\u002F\u002Fd3njjcbhbojbot.cloudfront.net\u002Fapi\u002Futilities\u002Fv1\u002Fimageproxy\u002Fhttps:\u002F\u002Fcoursera-instructor-photos.s3.amazonaws.com\u002F22\u002F98d700433f11e4bd3e2b34477023cb\u002FAndrewNg-Headshot.png","fullName":"Andrew Ng","title":"Associate Profes
